import axios from "./axios";

const baseUrl = "https://zkouge.cc/merchant";

// username  password code
export const login = obj => {
  return axios({
    url: `/merchant/login`,
    method: "POST",
    dataType: "json",
    data: obj
  });
};
export const userInfo = obj => {
  return axios({
    url: `/merchant/user/info`,
    method: "POST",
    dataType: "json",
    data: obj
  });
};

export const xx = obj => {
  return axios({
    url: `${baseUrl}/form/app/findFormVersion.do`,
    method: "POST",
    dataType: "json",
    data: obj
  });
};

export default {
  login,
  userInfo,
}
